import React from 'react'
import { Link } from 'react-router-dom'

export const Result = (props) => {
    return (
        <Link to='/result'>
            {
                props.result.map((course, i) => {
                    return <div key={i}>
                        {course.name}
                    </div>
                })}

        </Link>
    )
}
